import React from "react";
const url = 'http://localhost:8089/api/coin/getAllCoin';
const token = localStorage.getItem('token');
const AuthStr = 'Bearer '+token;
export default class Coin extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            error: undefined,
            isLoaded: false,
            coins : []
        }
        this.getData = this.getData.bind(this);
    }
   componentDidMount(){
     this.getData();
    }
    getData () {
        let headers = new Headers();
        headers.append('Content-Type', 'application/json');
        headers.append('Accept', 'application/json');  
        headers.append('Access-Control-Allow-Origin', 'http://localhost:8089');
        headers.append('Access-Control-Allow-Credentials', 'true');
        headers.append('GET', 'POST', 'OPTIONS');
        headers.append('Authorization',AuthStr);
        fetch(url, {
          method: 'GET',
          headers:headers
        })
            .then(res => res.json())
            .then(
              (result) => {
                this.setState({
                  isLoaded: true,
                  items: result
                });
                return result;
              },
              (error) => {
                this.setState({
                  isLoaded: true,
                  error
                  
                });
                return error;
              }
            )
        }
      
    render(){
        return (
            <div> 
            <h1>Coin List</h1>  
                <table className="table table-hover">
                    <thead>
                        <tr>
                            <th>CoinId</th>
                            <th>CoinName</th>
                            <th>Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                        this.state.coins.map(
                        coin =>
                        <tr key = {coin.coinId}>
                            <td>{coin.coinId}</td>
                            <td>{coin.coinName}</td>
                            <td>{coin.price}</td>
                        </tr>
                            )
                        }
                    </tbody>
            </table>
   </div>

        )
       
    }
}
